-- ----------------------------
-- Table structure for tb_menu
-- ----------------------------
DROP TABLE IF EXISTS `tb_menu`;
CREATE TABLE `tb_menu`
(
    `menu_id`     int                                                     NOT NULL AUTO_INCREMENT COMMENT '菜单主键id',
    `menu_name`   varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '菜单名称',
    `path`        varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '菜单路由（指前端路由路径）',
    `component`   varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '菜单组件',
    `icon`        varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '菜单图标',
    `parent_id`   int                                                     NULL DEFAULT NULL COMMENT '父菜单id',
    `is_hidden`   tinyint(1)                                              NULL DEFAULT 0 COMMENT '是否隐藏 0：不隐藏    1:隐藏',
    `sort`        int                                                     NULL DEFAULT 1 COMMENT '菜单排序',
    `is_delete`   tinyint(1)                                              NULL DEFAULT 0 COMMENT '逻辑删除 0：未删除    1:已删除',
    `create_time` datetime(0)                                             NULL DEFAULT NULL COMMENT '创建时间',
    `update_time` datetime(0)                                             NULL DEFAULT NULL COMMENT '更新时间',
    PRIMARY KEY (`menu_id`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 17
  CHARACTER SET = utf8
  COLLATE = utf8_general_ci
  ROW_FORMAT = DYNAMIC;

