DROP TABLE IF EXISTS `tb_video`;
CREATE TABLE `tb_video`
(
    `video_id`    int                                                     NOT NULL AUTO_INCREMENT COMMENT '视频主键id',
    `video_url`   varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '视频凭证（阿里云返回的视频id）',
    `video_name`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '视频名称',
    `chapter_id`  int                                                     NULL DEFAULT NULL COMMENT '章节id',
    `is_delete`   tinyint(1)                                              NULL DEFAULT 0 COMMENT '逻辑删除 0：未删除  1：已删除',
    `create_time` datetime(0)                                             NULL DEFAULT NULL COMMENT '创建时间',
    `update_time` datetime(0)                                             NULL DEFAULT NULL COMMENT '更新时间',
    PRIMARY KEY (`video_id`) USING BTREE,
    INDEX `chapter_id` (`chapter_id`) USING BTREE,
    CONSTRAINT `tb_video_ibfk_1` FOREIGN KEY (`chapter_id`) REFERENCES `tb_chapter` (`chapter_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB
  AUTO_INCREMENT = 5
  CHARACTER SET = utf8
  COLLATE = utf8_general_ci
  ROW_FORMAT = DYNAMIC;

